import React from "react";

import classes from "./LoginForm.module.css";

const LoginForm = () => {
  return (
    <div className={classes.container}>
      <form className={classes.loginForm}>
        <h1>Sign in</h1>
        <div>
          <span>New user?</span>
          <a href="/">Sign up!</a>
        </div>
      </form>
    </div>
  );
};

export default LoginForm;
